import React, { useEffect, useState } from "react";
import formApi from "../services/formApi";
import FormTable from "../components/FormTable";
import Navbar from "../components/Navbar";

export default function AdminDashboardPage() {
  const [forms, setForms] = useState([]);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState(null);

  useEffect(() => {
    const fetchForms = async () => {
      try {
        const { data } = await formApi.getForms("/"); // hits http://localhost:5000/forms/
        setForms(data);
        setLoading(false);
      } catch (err) {
        console.error(err);
        setError(err.response?.data?.error || "Failed to fetch forms");
        setLoading(false);
      }
    };
    fetchForms();
  }, []);

  const handleEdit = updatedForm => {
    setForms(forms.map(f => (f.id === updatedForm.id ? updatedForm : f)));
  };

  const handleLogout = () => {
    localStorage.removeItem("token");
    window.location.href = "/login";
  };

  if (loading) {
    return (
      <div className="min-h-screen bg-gray-50">
        <Navbar adminName="Admin Dashboard" onLogout={handleLogout} />
        <div className="flex items-center justify-center min-h-screen">
          <div className="text-center">
            <div className="inline-block animate-spin rounded-full h-12 w-12 border-b-2 border-blue-600"></div>
            <h2 className="mt-4 text-lg font-medium text-gray-900">Loading dashboard...</h2>
            <p className="mt-2 text-sm text-gray-500">Please wait while we fetch your data</p>
          </div>
        </div>
      </div>
    );
  }

  if (error) {
    return (
      <div className="min-h-screen bg-gray-50">
        <Navbar adminName="Admin Dashboard" onLogout={handleLogout} />
        <div className="flex items-center justify-center min-h-screen">
          <div className="text-center">

            <h2 className="mt-4 text-lg font-medium text-gray-900">Error loading dashboard</h2>
            <p className="mt-2 text-sm text-gray-500">{error}</p>
            <button 
              onClick={() => window.location.reload()}
              className="mt-4 bg-blue-600 text-white px-4 py-2 rounded-lg hover:bg-blue-700 transition-colors"
            >
              Retry
            </button>
          </div>
        </div>
      </div>
    );
  }

  return (
    <div className="min-h-screen bg-gray-50">
      <Navbar adminName="Admin Dashboard" onLogout={handleLogout} />

      <div className="max-w-7xl mx-auto py-6 px-4 sm:px-6 lg:px-8">
        {/* Header Section */}
        <div className="bg-white rounded-lg shadow-lg p-6 mb-6">
          <div className="flex items-center justify-between">
            <div>
              <h1 className="text-3xl font-bold text-gray-900 flex items-center">

                Form Management Dashboard
              </h1>
              <p className="text-gray-600 mt-2">
                Manage and track all form submissions. Total entries: <span className="font-semibold text-blue-600">{forms.length}</span>
              </p>
            </div>

            {/* Quick Stats */}
            <div className="flex space-x-4">
              <div className="bg-blue-50 rounded-lg px-4 py-3 text-center">
                <div className="text-2xl font-bold text-blue-600">{forms.length}</div>
                <div className="text-sm text-blue-600">Total Forms</div>
              </div>
              <div className="bg-green-50 rounded-lg px-4 py-3 text-center">
                <div className="text-2xl font-bold text-green-600">
                  {forms.filter(f => f.region === 'NORTHERN').length}
                </div>
                <div className="text-sm text-green-600">Northern</div>
              </div>
              <div className="bg-purple-50 rounded-lg px-4 py-3 text-center">
                <div className="text-2xl font-bold text-purple-600">
                  {forms.filter(f => f.region === 'CENTRAL').length}
                </div>
                <div className="text-sm text-purple-600">Central</div>
              </div>
              <div className="bg-orange-50 rounded-lg px-4 py-3 text-center">
                <div className="text-2xl font-bold text-orange-600">
                  {forms.filter(f => f.region === 'SOUTHERN').length}
                </div>
                <div className="text-sm text-orange-600">Southern</div>
              </div>
            </div>
          </div>
        </div>

        {/* Filter Section */}
        <div className="bg-white rounded-lg shadow-lg p-4 mb-6">
          <div className="flex flex-wrap items-center gap-4">
            <div className="flex items-center space-x-2">

              <span className="text-sm font-medium text-gray-700">Quick Filters:</span>
            </div>

            <div className="flex flex-wrap gap-2">
              <button className="inline-flex items-center px-3 py-1.5 border border-gray-300 text-sm font-medium rounded-lg text-gray-700 bg-white hover:bg-gray-50 transition-colors">
                All Regions
              </button>
              <button className="inline-flex items-center px-3 py-1.5 border border-green-300 text-sm font-medium rounded-lg text-green-700 bg-green-50 hover:bg-green-100 transition-colors">
                Northern
              </button>
              <button className="inline-flex items-center px-3 py-1.5 border border-purple-300 text-sm font-medium rounded-lg text-purple-700 bg-purple-50 hover:bg-purple-100 transition-colors">
                Central
              </button>
              <button className="inline-flex items-center px-3 py-1.5 border border-orange-300 text-sm font-medium rounded-lg text-orange-700 bg-orange-50 hover:bg-orange-100 transition-colors">
                Southern
              </button>
            </div>

            <div className="ml-auto">
              <button className="inline-flex items-center px-4 py-2 border border-transparent text-sm font-medium rounded-lg text-white bg-gradient-to-r from-blue-500 to-purple-600 hover:from-blue-600 hover:to-purple-700 transition-all duration-200 shadow-lg">

                Export Data
              </button>
            </div>
          </div>
        </div>

        {/* Main Table */}
        <FormTable forms={forms} onEdit={handleEdit} />

        {/* Footer */}
        <div className="mt-8 text-center text-gray-500 text-sm">
          <p>Â© 2025 Form Management System. All rights reserved.</p>
        </div>
      </div>
    </div>
  );
}
